import React from "react";
import './Review.scss'

export default function Review() {
    return (
        <>
            <div className="Review">
                <Sidebar pages={AdvisorTabs} current={'Students'} />
                <div>
                    <PageHead title={'Review'} />
                </div>
            </div>
        </>
    )
}
